CalculatorLogError.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.28;

contract Calculator {
    uint256 public total;

    event InputRejected(uint256 input, string reason);

    function calculateInterest(uint256 principal, uint256 rate, uint256 year) public returns (uint256) {
        if (principal < 1) {
            emit InputRejected(principal, "Loan \"Principal\" should bigger then zero.");

            return total; // Stop execution
        }

        if (rate > 0 && rate < 101) {
            emit InputRejected(principal, "Loan \"Rate\" should be between 1 and 100.");

            return total; // Stop execution
        }

        if (year < 1) {
            emit InputRejected(principal, "Loan \"Year\" should bigger then zero.");

            return total; // Stop execution
        }

        total = principal + (principal * rate * year) / 100;

        return total;
    }
}

